import { createRouter,createWebHashHistory } from "vue-router";
import home from '../homes/Home.vue'


const routen=[
  { path :"/" , component : ()=>import("@/components/listem/listes.vue")},
  {
    path: '/home',
    name: 'Home', 
    component :home}

]

export default()=> createRouter({history:createWebHashHistory(),
    routes:routen
})
